import React, { useState } from 'react';
import { Fab } from '@material-ui/core';
import { Add } from '@material-ui/icons';

function Homepage() {
  return (
    <div className='row'>
      <Fab color="red" aria-label="add">
        <Add />
      </Fab>
    </div>
  );
}

export default Homepage;
